import React from 'react';

const CarDetails = ({ car }) => {
  return (
    <div>
      <h2>Car Details</h2>
      <p>Name: {car.name}</p>
      <p>Available Time Slots: {car.timeSlots.join(', ')}</p>
    </div>
  );
};

export default CarDetails;
